import React from 'react';

import './currency-list-item.css';

const CurrencyListItem = ({data, getValue}) => {
	const elements = data.map((item) => {
		const {key, value} = item;

		return (
			<li onClick={() => onGetValue(value)} key={key} className="currencyListItem">{key}</li>
		);
	});
	return (
		<React.Fragment>
			{elements}
		</React.Fragment>
	);
};

export default CurrencyListItem;
